import { Routes } from 'react-router-dom';
import AboutUsPage from "./pages/AboutUsPage";
import DatabasePage from "./pages/DatabasePage";
import LoginPage from "./pages/LoginPage";

function App() {
  return (
    <div>
      <Routes path='/'>
        <DatabasePage />
      </Routes> 
      <Routes path='/about-us'>
        <AboutUsPage />
      </Routes>
      <Routes path='/login'>
        <LoginPage />
      </Routes>
    </div>
  );
}

export default App;
